+/* Saylani Form Styles */
+.saylani-form-container {
+  max-width: 800px;
+  margin: 0 auto;
+  padding: 20px;
+  font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
+}

+.saylani-form-header {
+  text-align: center;
+  margin-bottom: 30px;
+  background-color: #0d5eaf;
+  color: white;
+  padding: 15px;
+  border-radius: 5px;
+}
+
+.saylani-form-header h2 {
+  margin: 0;
+  font-size: 24px;
+}
+
+.saylani-form-header p {
+  margin: 5px 0 0;
+  font-size: 18px;
+}
+
+.saylani-form {
+  background-color: #f9f9f9;
+  padding: 25px;
+  border-radius: 5px;
+  box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
+}
+
+.form-group {
+  margin-bottom: 20px;
+}
+
+.form-group label {
+  display: block;
+  margin-bottom: 8px;
+  font-weight: bold;
+  color: #333;
+}
+
+.saylani-input, .saylani-select {
+  width: 100%;
+  padding: 12px;
+  border: 1px solid #ddd;
+  border-radius: 4px;
+  font-size: 16px;
+  box-sizing: border-box;
+}
+
+.saylani-input:focus, .saylani-select:focus {
+  outline: none;
+  border-color: #0d5eaf;
+  box-shadow: 0 0 5px rgba(13, 94, 175, 0.3);
+}
+
+.form-actions {
+  display: flex;
+  justify-content: space-between;
+  margin-top: 30px;
+}
+
+.saylani-submit-btn, .saylani-download-btn {
+  padding: 12px 25px;
+  border: none;
+  border-radius: 4px;
+  font-size: 16px;
+  cursor: pointer;
+  transition: background-color 0.3s;
+}
+
+.saylani-submit-btn {
+  background-color: #0d5eaf;
+  color: white;
+}
+
+.saylani-submit-btn:hover {
+  background-color: #0a4b8c;
+}
+
+.saylani-download-btn {
+  background-color: #28a745;
+  color: white;
+}
+
+.saylani-download-btn:hover {
+  background-color: #218838;
+}
