commits.content:
body {
  margin: 0;
  font-family: Arial, sans-serif;
  background: #f0f4f8;
}

.form-container {
  background: #fff;
  padding: 25px;
  max-width: 900px;
  margin: 40px auto;
  border-radius: 10px;
  box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
}

form {
  display: flex;
  flex-direction: column;
  gap: 15px;
}

h2 {
  text-align: center;
  margin-bottom: 20px;
}

.row {
  display: flex;
  gap: 15px;
  flex-wrap: wrap;
}

input,
select {
  flex: 1;
  padding: 10px;
  border: 2px solid #8bc34a;
  border-radius: 5px;
  font-size: 14px;
}

.file-upload {
  display: flex;
  flex-direction: column;
}

.file-upload input {
  padding: 5px;
}

button {
  background-color: #4caf50;
  color: white;
  padding: 12px;
  font-size: 16px;
  border: none;
  border-radius: 6px;
  cursor: pointer;
}

button:hover {
  background-color: #45a049;
}
